import React, { Component } from 'react';
import "./Chiffres.css";

class Chiffres extends Component {
    render() {
        return (
            <div>
                <h1>hello</h1>
                <table className="table">
                    <ul>Treso</ul>
                    <ul>NB ventes</ul>
                </table>
            </div>
          
        );
      }
}

export default Chiffres;
